import React from 'react';
import {Navbar} from "../ui/Navbar";
import {Navigate, Route, Routes} from "react-router-dom";
import MarvelPage from "../marvel/MarvelPage";
import DCPage from "../dc/DCPage";
import HeroesPage from "../heroes/HeroesPage";

const DashboardRouter = () => {
    return (
        <div>
            <Navbar />

            <Routes>
                <Route exact path = "/marvel" element = { <MarvelPage />} />
                <Route exact path = "/dc/" element = { <DCPage />} />
                <Route path = "/heroe/:heroeId" element = { <HeroesPage/>} />

                <Route render={() => <Navigate to="/marvel" />} />
            </Routes>

        </div>
    );
};

export default DashboardRouter;

